import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

const Nav = () => {
  const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => setMobileMenuOpen(!isMobileMenuOpen);

  return (
    <nav className="text-gray-500 shadow-md flex items-center pb-5 pt-5 pl-5 relative">
      <button
        className="md:hidden block text-2xl focus:outline-none"
        onClick={toggleMobileMenu}
        aria-label="Toggle mobile menu"
      >
        â˜°
      </button>

      <ul
        className={`md:flex md:space-x-6 md:static absolute left-0 top-full ${
          isMobileMenuOpen ? 'block z-10' : 'hidden'
        } bg-gray-800 bg-opacity-90 text-white rounded-lg shadow-lg p-3 mt-2`}
        style={{ maxWidth: '200px' }}
      >
        <li className="font-bold"><NavLink to="/" exact activeClassName="active">Nathan Morelli</NavLink></li>
        <li><NavLink to="/about" activeClassName="active">About</NavLink></li>
        <li><NavLink to="/portfolio" activeClassName="active">Services</NavLink></li>
        <li><NavLink to="/contact" activeClassName="active">Contact</NavLink></li>
      </ul>
    </nav>
  );
};


export default Nav;
